import {FETCH_ACTIVITIES, FETCH_EARNINGS, FETCH_LOGIN} from '../actions/actionCreator';

let initialState = [];

let activiesReducer = (state = initialState, action) =>{
    if(action.type === FETCH_EARNINGS){
        return{
            ...state,
            activities: action.payLoad,
        }
    }else if(action.type === FETCH_LOGIN){
        return{
            ...state,
            earnings: action.payLoad,
        }
    }

    return state;
}

export default activiesReducer;
